function Button({ 
    children,
    primary,
    secondary,
    success,
    warning,
    danger, 
    rounded,
    outline
}){
    return <button>{children}</button>;
}

Button.propTypes = {
    checkVariationValue: (props) => {
        console.log(props);
        return new Error('Invalid props')
    }
}

export default Button;
